        History of the Blues\",\"numberOfTracks\":81,\"numberOfVideos\":0,\"creator\":{},\"description\":\"The
        origins of the blues can be traced to the sharecropping communities of the
        Mississippi Delta at the end of the 19th and the beginning of the 20th century,
        fusing traditional African music with spirituals, call-and-response shouts
        and chants, work songs and field hollers and European folk music. Flaring
        up next in Southern Texas and throughout the Deep South, the fledgling music
        form would eventually spread like a wildfire, mutating and growing in popularity
        over time, all while infecting or influencing nearly all popular music styles
        that came after. Without the development of the blues, we would have no soul,
        no R&B, no hip-hop, and certainly no rock and roll. Even though the blues
        can be dated a lot earlier, among the first known songs using the term are
        \u201CI Got the Blues\u201D (1908), \u201CDallas Blues\u201D and W.C Handy\u2019s
        \u201CThe Memphis Blues\u201D (both 1912), while Mamie Smith\u2019s \u201CCrazy
        Blues\u201D is the first recording by an African-American singer \u2013 and
        appropriately the first song on this playlist where we introduce you to 100
        years of the blues. This roughly chronological playlist will guide you through
        the genre's evolution, from traditional blues styles of the Delta and Piedmont
        blues, Chicago and West Coast blues, the transition from acoustic to electric
        blues and the growth of blues rock and other hybrids. From Charley Patton
