        Songs of the Year\",\"numberOfTracks\":45,\"numberOfVideos\":0,\"creator\":{},\"description\":\"1995
        was a big year for music. The Rock and Roll Hall of Fame opened its doors,
        and the sad loss of Jerry Garcia led to the dissolution of the Grateful Dead,
        at least initially. At the Grammys Tony Bennett won Album of the Year for
        his MTV Unplugged set, and Sheryl Crow\u2019s \u201CAll I Wanna Do\u201D took
        Record of the Year. * More notably, what a year it was for new music! To sum
        up 1995 in just three words: Britpop, Bristol, and Post-grunge. In London
        and Manchester, respectively, Blur and Oasis began competing for chart dominance
        in what the press dubbed \u201CThe Battle of Britpop,\u201D with Pulp and
        Supergrass right on their tails. Less visibly, but just as vitally, the Bristol
        underground scene came into its own thanks in no small part to Tricky, Massive
        Attack, and Leftfield. On both sides of the Atlantic, with the world still
        reeling from Kurt Cobain\u2019s 1994 suicide, post-grunge was ascending to
        eminence with a landslide of artists that ranged from Alice in Chains and
        Mad Season to Alanis Morissette, Collective Soul and Dave Grohl\u2019s then-new
        Foo Fighters. * Outside the trappings of particular scenes, 1995 marked the
        birth of legendary albums including Pavement\u2019s Wowee Zowee, Smashing
        Pumpkins\u2019 Mellon Collie and the Infinite Sadness, Rancid\u2019s \u2026And
        Out Come the Wolves, The Flaming Lips\u2019 Clouds Taste Metallic, Mobb Deep\u2019s
        The Infamous, and D\u2019Angelo\u2019s Brown Sugar. * To take you back down
        memory lane, or perhaps to appreciate a grand year for the first time, enjoy
        our playlist of vintage \u201995 goodies. Rather than replicate the Billboard
        charts, we opted to handpick tracks and albums that have stood up to the test
        of time and proved themselves still relevant after eventful 20 years.\",\"duration\":15899,\"lastUpdated\":\"2023-04-19T12:11:51.000+0000\",\"created\":\"2015-01-19T12:54:35.000+0000\",\"type\":\"EDITORIAL\",\"publicPlaylist\":true,\"url\":\"http://www.tidal.com/playlist/cf6fa1c4-4812-4ded-a765-842e1c04b4dd\",\"image\":\"c91ac2b5-2ca3-4a68-bc3d-04c2d07661bb\",\"popularity\":32,\"squareImage\":\"8ebacd76-050d-421a-bf74-3bf0127672df\",\"promotedArtists\":[{\"id\":3501428,\"name\":\"Elliott
