        and Sesame Street. 1969 was also a landmark year in the history music. The
        Beatles released their final studio album, but we got debut albums from Led
        Zeppelin, Joe Cocker, The Stooges, Nick Drake, MC5 and many more. These were
        the glory days for Folk rock; Creedence Clearwater Revival (three albums!),
        Fairport Convention (three albums!), Townes van Zandt (two albums!), Flying
