        Days: The Years That Shaped Modern Music (1966-1970)\",\"numberOfTracks\":100,\"numberOfVideos\":0,\"creator\":{},\"description\":\"The
        period 1966 to 1970 may be the most revolutionary era in modern music history.
        This is when pop music emerged out of its childhood innocence and became a
        genuine and daring art form. Open experimental will, new technologies, mind-expanding
        aids and a turbulent cultural landscape made for the explosive development
        of this vital era, which laid the foundation for what would later happen in
        popular music for the next 50 years. The second half of the 1960s gave us
        some of the century\u2019s most groundbreaking music - music that is still
        a benchmark for what is made today. This is not a collection of the biggest
        hits, but rather some of the spearheads, the pioneers, the boundless visionaries
        of the time. Some remain well-known while others have been less remembered,
        but all of these artists contributed to the growth and shape of a period that
        still influences music and culture today. (Cover: The Beatles / Photo: UMG,
        press)\",\"duration\":31213,\"lastUpdated\":\"2022-10-27T12:02:47.000+0000\",\"created\":\"2014-10-01T10:11:36.000+0000\",\"type\":\"EDITORIAL\",\"publicPlaylist\":true,\"url\":\"http://www.tidal.com/playlist/016909d9-bd38-403f-ac39-65d5ee24db8b\",\"image\":\"caa03f8c-499d-42f3-acec-1810c0adbf01\",\"popularity\":22,\"squareImage\":\"c0553f88-1d32-4cee-9c8f-921539bb7e0c\",\"promotedArtists\":[{\"id\":3634161,\"name\":\"The
