        Songs of the Year\",\"numberOfTracks\":100,\"numberOfVideos\":0,\"creator\":{},\"description\":\"Most
        people might whistle along to Louis Armstrong\u2019s \\\"What a Wonderful
        World,\\\" but it is rather rage and violence that follows the flowery peace
        rallies from the 1967 Summer of Love. The war in Vietnam intensifies with
        the Tet Offensive, Robert Kennedy and Martin Luther King Jr. are both being
        assassinated, civil rights activists clash with the law enforcement on college
        campuses and several US cities, including Chicago, DC and Baltimore are burning
        in chaotic and violent riots. Tommie Smith and John Carlos bowed their heads
        and raised their fists in a Black Power salute during the Mexico Summer Olympics,
        and the Khmer Rogue forms in Cambodia. Moviegoers are enjoying \u20182001:
        A Space Odyssey,' \u2018Rosemary\u2019s Baby\u2019 or \u2018The Planet of
        the Apes,' and the musical \u2018Hair\u2019 premieres on Broadway. Amidst
        all the turmoil and tension, some of the most iconic albums in the history
        of music are being launched: The Beatles\u2019 \u2018White Album,' Jimi Hendrix\u2019s
        \u2018Electric Ladyland,' Van Morrison\u2019s \u2018Astral Weeks\u2019 and
        The Band\u2019s \u2018Music From the Big Pink\u2019 are some of the many albums
        making 1968 an outstanding year of music. Enjoy this travel back to some of
