        & Strings\",\"numberOfTracks\":38,\"numberOfVideos\":0,\"creator\":{},\"description\":\"In
        the mid to late 1960s, many pop artists began to expand their sound to include
        a more ornate instrumental palette, introducing orchestral elements borrowed
