        Focus: Matador\",\"numberOfTracks\":88,\"numberOfVideos\":0,\"creator\":{},\"description\":\"Starting
        out of an NYC apartment to release an EP for Australian trio H.P. Zinker in
        1989, Matador Records has been at the forefront of the ever-changing landscapes
        of indie rock and independent music at large. From guitar-based rock darlings
        like Pavement and Car Seat Headrest, to the adventurous, ethereal stylings
        of groups like Perfume Genius and Majical Cloudz, Matador's purveyance of
