        & Traces: Nick Drake\",\"numberOfTracks\":48,\"numberOfVideos\":0,\"creator\":{},\"description\":\"English
        singer-songwriter Nick Drake (1948-1974) only released three studio albums
        during his tragically short life span, and he never lived to witness wide
        recognition for his music. Drake was part of the blooming contemporary English
        folk circuit of the late 1960s and early 1970s, alongside the likes of Fairport
        Convention, John and Beverley Martin, Donovan, Bert Jansch and many others.
        Never fully a part of the scene, caused partly by his reluctance to perform,
        a fragile mental health and his shy nature, the music of Nick Drake has outlasted
        most of his peers. The three studio albums all share his distinct qualities;
        the hushed, beautiful voice, magnificent guitar playing, eloquent poetry and
        quintessential Englishness, but each are graced with a unique sound. \u2018Five
        Leaves Left\u2019 (1969) captures the mind of a young, literate Cambridge
        scholar, a tweed-draped romance of Woodsworth and Rizla. \u2018Bryter Layter\u2019
        (1971) evokes the melancholia of foggy city streets and autumnal parks, a
        lush and well-orchestrated masterpiece. In stark contrast, \u2018Pink Moon\u2019
        (1972) is a bleak and introvert glimpse into a troubled and brilliant mind.
        He passed away from an overdose of anti-depressants only two years later.
        Drake never lived to enjoy the legacy of his career, but today he is widely
        considered one of the most revered and influential songwriters of the 20th
        century. With Tracks & Traces, we aim to expand the horizon around a given
        artist with related tracks and similar artists in order to present a deeper
        insight into their music. (Photo: Rovi)  \",\"duration\":11738,\"lastUpdated\":\"2023-06-19T07:51:56.000+0000\",\"created\":\"2019-06-24T13:48:13.000+0000\",\"type\":\"EDITORIAL\",\"publicPlaylist\":true,\"url\":\"http://www.tidal.com/playlist/9a42ccef-884e-4569-8b9a-139032b89851\",\"image\":\"d614897c-9d7f-4fea-829e-d9ec0818bb9b\",\"popularity\":5,\"squareImage\":\"6c0fe549-0ebe-465a-9275-30bc49bd69b8\",\"promotedArtists\":[{\"id\":24886,\"name\":\"John
