        Essentials\",\"numberOfTracks\":31,\"numberOfVideos\":0,\"creator\":{},\"description\":\"Bubbling
        up from Detroit's murky depths in the early '90s, Drexciya rapidly established
        themselves as one of the most influential duos in underground electronic music.
        Comprised of James Stinson and Gerald Donald, Drexciya forged a close relationship
        with the Underground Resistance outfit, sharing a penchant for evocative acid-drenched
        techno shrouded in mystery and lore. Central to the duo's mythos was the afrofuturist
        idea of \\\"Drexciya\\\"; an underwater nation inhabited by the unborn children
        of pregnant African women thrown overboard from slave ships. The women gave
        birth to water-breathers\u2013\u2013the Drexciyans\u2013\u2013who developed
        a superior, technologically-advanced civilization undisturbed beneath the
        ocean. Today Drexciya are revered as champions of an unapologetically black
        art-form, and are credited as major players in techno's expansion far beyond
        its original confines. (Photo: Rovi)\",\"duration\":12950,\"lastUpdated\":\"2021-03-01T19:29:56.000+0000\",\"created\":\"2019-09-18T19:13:47.000+0000\",\"type\":\"EDITORIAL\",\"publicPlaylist\":true,\"url\":\"http://www.tidal.com/playlist/9d20cd8b-e1a6-4bfa-a18e-f8cafee550c0\",\"image\":\"f35dd5ad-7883-4af2-a75c-3e56fca3fb1b\",\"popularity\":3,\"squareImage\":\"e6439cfe-e9ad-4cd0-a710-6584d0012d7a\",\"promotedArtists\":[{\"id\":3712638,\"name\":\"Drexciya\",\"type\":\"MAIN\",\"picture\":\"4af05f47-0a84-4941-be81-34a192e8373c\"}],\"lastItemAddedAt\":null},{\"uuid\":\"1d8df02f-0c97-4933-b3b4-7d6ceb33ddd5\",\"title\":\"Bob
